import React from 'react';
import { rtdb } from './config';

/**
 * A simple Firebase status component that doesn't use any listeners
 * to avoid Temporal Dead Zone errors
 */
const FirebaseDebugger = () => {
  // Simple component that doesn't use useEffect or any listeners
  const dbStatus = rtdb ? 'Firebase initialized' : 'Firebase not initialized';
  
  return (
    <div style={{
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
      fontFamily: 'monospace',
      backgroundColor: '#f5f5f5',
      borderRadius: '8px'
    }}>
      <h2>Firebase Status</h2>
      
      <div style={{ margin: '20px 0' }}>
        <p>Status: {dbStatus}</p>
        <p>Database URL: {rtdb?.app?.options?.databaseURL || 'Not configured'}</p>
      </div>
      
      <div style={{ 
        padding: '15px',
        backgroundColor: '#e3f2fd',
        borderRadius: '8px',
        borderLeft: '4px solid #2196f3'
      }}>
        <p style={{ margin: 0 }}>
          <strong>Note:</strong> Advanced debugger was removed to fix stability issues.
          Check browser console for Firebase logs.
        </p>
      </div>
    </div>
  );
};

export default FirebaseDebugger;
